[[backends]]
  group = "google-cloud-machine-learning-engine-v1"
  url_pattern = "/v1/{name}"
  method = "GET"
  host = ["https://ml.googleapis.com"]
  url_keys = ["name"]
  whitelist = ["createTime", "endTime", "errorMessage", "jobId", "startTime", "state"]
  concurrent_calls = 1
  [backends.extra_config]
    provider = "googleapis.com"
    description = "An API to enable creating and using machine learning models."
    version = "v1"
    slug = "google-cloud-machine-learning-engine-v1-v1-name"
    schemes = ["https"]
    hosts = ["https://ml.googleapis.com"]
    topics = ["machine-learning", "projects"]
    [backends.extra_config.mapping]
      createTime = "createTime"
      endTime = "endTime"
      errorMessage = "errorMessage"
      jobId = "jobId"
      startTime = "startTime"
      state = "state"

